import { SideNav } from "./SideNav";

export const Home = () => {
  return (
    <main>
      <SideNav />
      <section className="hero">
        <div className="hero_title">
          <h1 className="title">Login</h1>
        </div>
      </section>

      <section className="gallery">put pic of user 12 and 18</section>
    </main>
  );
};
